WITH base AS ( SELECT client_id, MOD(ABS(FARM_FINGERPRINT(MD5(client_id))), 20) AS id_bucket, DATE_SUB(submission_date, INTERVAL 13 DAY) AS date, COUNTIF(udf.bitpos(days_created_profile_bits) = 13) AS new_profiles, COUNTIF(udf.active_n_weeks_ago(days_seen_bits, 1)) AS active_in_week_0, COUNTIF(udf.active_n_weeks_ago(days_seen_bits, 1) AND udf.active_n_weeks_ago(days_seen_bits, 0)) AS active_in_weeks_0_and_1, COUNTIF(udf.bitpos(days_created_profile_bits) = 13 AND udf.active_n_weeks_ago(days_seen_bits, 0)) AS new_profile_active_in_week_1 FROM telemetry.clients_last_seen -- We need to "rewind" 13 days since retention is forward-looking; -- we calculate retention for "day 0" based on clients_last_seen data from "day 13". WHERE DATE_SUB(submission_date, INTERVAL 13 DAY) = "2019-10-01" GROUP BY client_id, submission_date
), bucketed AS ( SELECT date, -- There are many options for hashing client_ids into buckets; -- the below is an easy option using native BigQuery SQL functions; -- see discussion in https://github.com/mozilla/bigquery-etl/issues/36 MOD(ABS(FARM_FINGERPRINT(client_id)), 20) AS id_bucket, SUM(active_in_weeks_0_and_1) AS active_in_weeks_0_and_1, SUM(active_in_week_0) AS active_in_week_0 FROM base WHERE id_bucket IS NOT NULL GROUP BY date, id_bucket
) SELECT `date`, udf_js.jackknife_ratio_ci(20, ARRAY_AGG(STRUCT(CAST(active_in_weeks_0_and_1 AS float64), CAST(active_in_week_0 as FLOAT64)))) AS one_week_retention
FROM bucketed
GROUP BY `date` ORDER BY `date` Found a bug? Edit this file on GitHub.

